(1, NULL, 'About-us', '<p><strong>Introduction</strong></p>\r\n\r\n<p>Welcome to Headway Business Solutions LLP, where innovation meets brilliance in the world of jewellery business coaching and consulting. As a leading enterprise in the industry, we are dedicated to guiding jewellery entrepreneurs towards outstanding success.</p>\r\n\r\n<p>At Headway, we understand that the jewellery business is not just about beautiful ornaments; it&#39;s a delicate balance of productive operations, strategic marketing, and artistic jewellery products. Our seasoned team of experts brings a wealth of experience to the table, offering tailored solutions that propel your business forward. Join hands with us; we are committed to achieving lasting success for your business.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Our&nbsp;Mission</strong></p>\r\n\r\n<ul>\r\n	<li>At Headway Business Solutions LLP, our mission is to help every jewellery business thrive, setting new benchmarks for success.</li>\r\n	<li>We&#39;re committed to equipping jewellery businesses with the tools they need to succeed in the ever-evolving customer needs.</li>\r\n	<li>Besides, We are dedicated to nurturing startups and accelerating growth for established jewellers.</li>\r\n	<li>Through custom-made strategies, innovative insights, and unwavering support, we are devoted to turning your aspirations into achievements.</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Our&nbsp;Vision</strong></p>\r\n\r\n<ul>\r\n	<li>Headway Business Solutions LLP aims to be the best in the world at coaching and advising jewellery businesses.</li>\r\n	<li>We want all our partner jewellers to succeed.</li>\r\n	<li>We&#39;ll help them with top-notch advice, creative strategies, and powerful solutions, hoping to take their jewellery businesses to unprecedented levels of success.</li>\r\n</ul>', 1, 0, '2025-01-26 23:28:48', '2025-05-26 03:09:16'),
(2, NULL, 'Privacy Policy', '<p>At Headway Business Solutions LLP, your privacy is important to us. This Privacy Policy summarizes how we collect, use, share, and protect your information when you interact with our platform as a jewellery business coach and consultant company. By accessing our services, you agree to the terms outlined in this policy.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><strong>Applicability of Privacy Policy for Headway Business Solutions LLP</strong></h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>This Privacy Policy applies to all users of the services provided by Headway Business Solutions LLP, a jewellery business coach and consultant company. By using our services, you agree to the terms mentioned in this policy. This policy applies to the collection, use, and disclosure of personal information by Headway Business Solutions LLP and its affiliated entities.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><strong>Individual Users</strong></h3>\r\n\r\n<p>Individual users who access our platform are subject to this Privacy Policy. It includes website browsers, entrepreneurs, business owners, and all other individuals seeking guidance and support from this website (headway.org.in).</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><strong>Business Entities</strong></h3>\r\n\r\n<p>Business entities, including jewellery companies, retailers, wholesalers, showroom owners, jewellery makers, and other related businesses, that engage with Headway Business Solutions LLP for consulting services are also covered under this Privacy Policy.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><strong>Employees and Representatives</strong></h3>\r\n\r\n<p>Employees, representatives, contractors, and agents of Headway Business Solutions LLP who handle personal information as part of their duties are required to adhere to the provisions outlined in this Privacy Policy.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><strong>Third Parties</strong></h3>\r\n\r\n<p>Third-party service providers, partners, and vendors engaged by Headway Business Solutions LLP to deliver services or support operations are expected to comply with similar privacy standards and obligations.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><strong>Website Visitors</strong></h3>\r\n\r\n<p>Visitors to our website, including individuals browsing our content, accessing resources, or seeking information about our services, are subject to the terms of this Privacy Policy.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><strong>Applicability Beyond Geographical Boundaries</strong></h3>\r\n\r\n<p>This Privacy Policy applies to users and interactions regardless of their geographical location. Whether you access our services from within or outside the territories where Headway Business Solutions LLP operates, this policy governs the handling of your information.</p>\r\n\r\n<p>More Detail :&nbsp;<a href=\"https://headway.org.in/#/privacy_policy\">https://headway.org.in/#/privacy_policy</a></p>\r\n\r\n<p>&nbsp;</p>', 1, 0, '2025-01-31 01:24:03', '2025-05-26 03:09:48'),
(3, NULL, 'Terms & Condition', '<p>Welcome to Headway Business Solutions LLP (&quot;Headway,&quot; &quot;we,&quot; &quot;us,&quot; or &quot;our&quot;). These Terms and Conditions (&quot;Terms&quot;) govern your access to and use of our website (www.headway.org.in), mobile application (the &quot;App&quot;), and all associated services (collectively, the &quot;Service&quot;). Please read them carefully before proceeding.</p>\r\n\r\n<p>These terms and conditions of use (&ldquo;Terms of Use&rdquo;) are between the Company, and the User(s), who are registered with us, or who use the Website and/or the App (hereinafter referred to as &ldquo;You&rdquo; or &ldquo;Your&rdquo; or &ldquo; User(s)&rdquo;).</p>\r\n\r\n<p>Please read these Terms of Service as they shall govern your use of the Headway Business Solutions LLP website and app. By using or visiting the Headway Business Solutions LLP website, app, or any Headway Business Solutions LLP products, software, data feeds, and services provided to you on, from, or through the Headway Business Solutions LLP website (collectively the &ldquo;Service&rdquo;) you signify your agreement to</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><strong>2. Headway Business Solutions LLP&rsquo;s Privacy Policy</strong></h3>\r\n\r\n<p>found at https://headway.org.in/privacy-policy and incorporated herein by reference and any other terms that are updated from time to time. If you do not agree to any of these terms or the Privacy Policy, please do not use this website.</p>\r\n\r\n<p>These Terms of Service are published in accordance with the provisions of Rule 3 (1) of the Information Technology (Intermediaries guidelines) Rules, 2011 that require publishing the rules and regulations, privacy policy and terms and conditions for access or usage of the Website and/or App.</p>\r\n\r\n<p>We may attempt to notify you when major changes are made to these Terms of Service. You should occasionally review the most up-to-date version of www.headway.org.in Headway Business Solutions LLP may, in its sole discretion, modify or revise these Terms of Service and policies at any time, and you agree to be bound by such modifications or revisions.</p>\r\n\r\n<p>Your continued use of the Services post any modification of the Terms of Service shall be taken as your consent and acceptance of such modifications. Nothing in these Terms of Service shall be deemed to confer any third-party rights or benefits.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h2><strong>Ownership and Registration</strong></h2>\r\n\r\n<p>The domain name, website, and app are owned, registered, and operated by &quot;Headway Business Solutions LLP,&quot; a limited liability partnership incorporated under the (Indian) Companies Act, 2008. Our registered office is located at 305, Supermall, C G Road, Near Lal Bunglow, Navrangpura, Ahmedabad - Gujarat, and our corporate office is situated at Supermall, C G Road, Near Lal Bunglow, Navrangpura, Ahmedabad - Gujarat, India.</p>\r\n\r\n<h3><strong>Service</strong></h3>\r\n\r\n<p>Headway Business Solutions provides jewellery business coaching and consulting services through its Platform. We offer educational resources, training materials, and expert guidance to individuals and businesses in the jewellery industry.</p>\r\n\r\n<p>The Website and/or App is an online platform that supports and facilitates the online creation of educational videos/or tutorials, by the Users of the Website and/or App as an intermediary between the educator and the user (&lsquo;Service&rdquo;). A User may create a video, audio clip, or tutorial, by using our Services. Such content uploaded through the use of our Services or otherwise submitted to us for uploading on our Website and/or App shall hereinafter be referred to as &ldquo;User Content&rdquo;.</p>\r\n\r\n<p>You agree and acknowledge that Headway Business Solutions LLP has no control over and assumes no responsibility for the User Content and by using the Service, you expressly relieve Headway Business Solutions LLP from any and all liability arising from the User Content.</p>\r\n\r\n<p>The Service may include or contain links to any third-party websites that may or may not be owned or controlled by Headway Business Solutions LLP. Headway Business Solutions LLP has no control over and assumes no responsibility for, the content, privacy policies, or practices of any third-party websites.</p>\r\n\r\n<p>In addition, Headway Business Solutions LLP will not and cannot censor or edit the content of any third-party site. By using the Service, you expressly relieve Headway Business Solutions LLP from any and all liability emerging from your use of any third-party website or services. However, we recommend that before you use any third-party service or website you read and understand the terms and conditions and privacy policy of each website that you visit.</p>\r\n\r\n<p>Subject to these Terms of Service and the Privacy Policy, Headway Business Solutions LLP hereby grants the user a limited, non-transferable, non-exclusive, limited privilege to use this Website and/or App.</p>\r\n\r\n<p>You agree and acknowledge that Headway Business Solutions LLP shall have the right at any time to change or discontinue any aspect or feature of the Website and/or App, including, but not limited to, the User Content, hours of availability, and equipment needed for access or use. Further, Headway Business Solutions LLP may terminate publishing any portion of information or category of information may change or eliminate any transmission method, and may change transmission speeds or other signal characteristics.</p>\r\n\r\n<p>Headway Business Solutions LLP reserves the right to refuse access to the Website and/or App, terminate Accounts, or remove or edit contents without any notice to You.</p>\r\n\r\n<p>More Detail :&nbsp;<a href=\"https://headway.org.in/#/terms_and_conditions\">https://headway.org.in/#/terms_and_conditions</a></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', 1, 0, '2025-01-31 01:28:38', '2025-05-26 03:15:01'),
