(3, 0, 'Jewellery Vidhyapith', '1737626379.png', 'Headway Business Solutions LLP is your strategic partner in propelling your newly started jewellery store towards accelerated growth.', '<h2><strong>Services and Curriculum</strong></h2>\n\n<p>Leveraging state-of-the-art software and methodologies, our team of experts is dedicated to providing high-quality training that prepares students for immediate industry entry.</p>\n\n<ul>\n	<li>Processing</li>\n	<li>Jewellery manufacturing</li>\n	<li>Diamond cutting</li>\n	<li>Diamond cutting</li>\n	<li>Stock management</li>\n	<li>Leadership</li>\n	<li>Customer relations</li>\n	<li>Communication skills</li>\n	<li>Body language</li>\n	<li>Personality development</li>\n	<li>Insights into wholesale and retail business</li>\n	<li>Accounting</li>\n</ul>\n\n<p><img src=\"data:image/png;base64,\" /></p>\n\n<p>&nbsp;</p>\n\n<h2><strong>Learn. Create. Shine. Repeat.</strong></h2>\n\n<h3><strong>Training Mode and Duration</strong></h3>\n\n<p><strong>The three-month training program will be delivered through both online and offline modes, ensuring accessibility and convenience for all participants. We plan to conduct 15 to 20 sessions, each lasting two hours, tailored to instill both theoretical knowledge and practical skills in our students.</strong></p>\n\n<p>&nbsp;</p>\n\n<h3><strong>Investment in Future Talent</strong></h3>\n\n<p><strong>The three-month training program will be delivered through both online and offline modes, ensuring accessibility and convenience for all participants. We plan to conduct 15 to 20 sessions, each lasting two hours, tailored to instill both theoretical knowledge and practical skills in our students.</strong></p>\n\n<p>&nbsp;</p>\n\n<h3><strong>Certification and Employment</strong></h3>\n\n<p><strong>The three-month training program will be delivered through both online and offline modes, ensuring accessibility and convenience for all participants. We plan to conduct 15 to 20 sessions, each lasting two hours, tailored to instill both theoretical knowledge and practical skills in our students.</strong></p>', 1, 0, '2025-01-23 09:59:39', '2025-01-23 09:59:39');
