(28, 5, 'Salary Negotiation', '1738051218.png', 'Salary Negotiation', '<p>Our team negotiates competitive salaries on your behalf, ensuring that you attract and retain top talent in the industry.</p>', 1, 0, '2025-01-28 08:00:18', '2025-01-28 08:00:18'),
