(30, 6, 'Mobile App Design', '1738052065.png', 'Mobile App Design', '<p>Develop intuitive and engaging mobile applications that enable jewellers to connect with their customers on the go, offering seamless access to products and services.</p>', 1, 0, '2025-01-28 08:14:25', '2025-01-28 08:14:51'),
(31, 6, 'Website Development', '1738052801.png', 'Website Development', '<p>Craft visually stunning and user-friendly websites tailored specifically for jewellers, providing an immersive online experience for customers and driving engagement.</p>', 1, 0, '2025-01-28 08:26:41', '2025-01-28 08:26:41'),
(32, 6, 'Mobile App Development', '1738053135.png', 'Mobile App Development', '<p>Develop intuitive and engaging mobile applications that enable jewellers to connect with their customers on the go, offering seamless access to products and services.</p>', 1, 0, '2025-01-28 08:32:15', '2025-01-28 08:32:15'),
(33, 6, 'Search Engine Marketing and SEO', '1738053206.png', 'Search Engine Marketing and SEO', '<p>Optimize websites for search engines and implement strategic search engine marketing campaigns to improve visibility and drive targeted traffic to jewellers&#39; websites.</p>', 1, 0, '2025-01-28 08:33:26', '2025-01-28 08:33:26'),
(34, 6, 'Social Media Marketing', '1738053227.png', 'Social Media Marketing', '<p>Harness the power of social media platforms to build brand awareness, engage with customers, and drive sales through targeted advertising and compelling content.</p>', 1, 0, '2025-01-28 08:33:47', '2025-01-28 08:33:47'),
(35, 7, 'My Bharatiya Zaveri Bazaar  (My BzB)', '1747821574.webp', 'My Bharatiya Zaveri Bazaar \r\n(My BzB)', '<p>Discover My Bharatiya Zaveri Bazaar (MyBzB), an online jewellery shopping platform by Headway Business Solutions LLP, dedicated to showcasing the timeless allure of Indian jewellery craftsmanship.</p>', 1, 0, '2025-01-28 09:05:52', '2025-05-21 09:59:34'),
(36, 7, 'Suvarna Saubhagya Utsav (SSU)', '1747821511.png', 'Suvarna Saubhagya Utsav (SSU)', '<p>Suvarna Saubhagya Utsav is a prestigious annual event organized by Headway Business Solutions LLP, offering customers an unparalleled opportunity to indulge in exquisite jewellery purchases while standing a chance to win exciting prizes through a lucky draw.</p>', 1, 0, '2025-01-28 09:06:30', '2025-05-21 09:58:31'),
